 SELECT kernel_dp."KEY" AS "KEY", CAST(499.0928844651739 AS DOUBLE PRECISION) + CAST(374.0338110593958 AS DOUBLE PRECISION) * kernel_dp.dot_product AS "Estimator" 
FROM kernel_dp